export const addProductRequest = createAction("cart/addProductRequest");
export const addProductSuccess = createAction("cart/addProductSuccess");
export const addProductError = createAction("cart/addProductError");

export const deleteProductRequest = createAction("cart/deleteProductRequest");
export const deleteProductSuccess = createAction("cart/deleteProductSuccess");
export const deleteProductError = createAction("cart/deleteProductError");
